import React from 'react';
import './Footer.css'; // Assuming you have a CSS file for styling

function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <div className="footer-content">
          <div className="social-media">
            <a href="https://github.com/tejak2719" target="_blank" rel="noopener noreferrer">
              <img src="github-icon.png" alt="GitHub Tejak2719" className="social-icon" />
            </a>
            <a href="https://github.com/vmrt01" target="_blank" rel="noopener noreferrer">
              <img src="github-icon.png" alt="GitHub Vmrt01" className="social-icon" />
            </a>
          </div>
          <p>&copy; 2024 STRK N VMRT. All rights reserved.</p>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
